import React, {useState} from 'react'

import {Autorize} from "../../containers"
import { Loading } from '../../components';

const AutorizePage = () => {
    const [autorized, setAutorized] = useState(null);
    const [loading, setLoading] = useState(true);
    
    return (
        <div >
            {
                autorized && loading === false ? <Autorize></Autorize> : Loading
            }    
        </div>
    )
}

export default AutorizePage
